problem:
Find $XY$ in the triangle below.


[asy]
unitsize(1inch);
pair P,Q,R;
P = (0,0);
Q= (1,0);
R = (0,1);
draw (P--Q--R--P,linewidth(0.9));
draw(rightanglemark(Q,P,R,3));
label("$X$",P,S);
label("$Y$",Q,S);
label("$Z$",R,N);
label("$12\sqrt{2}$",(Q+R)/2,NE);
label("$45^\circ$",(0.7,0),N);
[/asy]

Find $XY$ in the triangle below.


[asy]
unitsize(1inch);
pair P,Q,R;
P = (0,0);
Q= (1,0);
R = (0,1);
draw (P--Q--R--P,linewidth(0.9));
draw(rightanglemark(Q,P,R,3));
label("$X$",P,S);
label("$Y$",Q,S);
label("$Z$",R,N);
label("$12\sqrt{2}$",R/2,W);
label("$45^\circ$",(0.7,0),N);
[/asy]

The two figures shown are made of unit squares. What is the positive difference of the perimeters, in units?

[asy]
draw((0,0)--(0,1)--(5,1)--(5,0)--cycle,linewidth(1));
draw((1,0)--(1,2)--(4,2)--(4,0),linewidth(1));
draw((2,-1)--(2,3)--(3,3)--(3,-1)--cycle,linewidth(1));
draw((7,0)--(7,2)--(12,2)--(12,0)--cycle,linewidth(1));
draw((7,1)--(12,1),linewidth(1));
draw((8,0)--(8,2),linewidth(1));
draw((9,0)--(9,2),linewidth(1));
draw((10,0)--(10,2),linewidth(1));
draw((11,0)--(11,2),linewidth(1));

[/asy]

Carpet costs $\$21.95$ per square yard and the padding to put under it costs $\$2.55$ per square yard. Felix plans to install padding and carpet in the region shown in the diagram. What is the cost of the carpet and padding needed to exactly cover the room?

[asy]
unitsize(0.2 inch);
//import geometry;
draw((0,0)--(9,0)--(9,2)--(4,2)--(4,5)--(0,5)--(0,0));

label("4 yds",(2,5),N);
label("3 yds",(4,3.5),E);
label("5 yds",(6.5,2),N);
label("2 yds",(9,1),E);

[/asy]

Two shaded quarter-circles, each with a radius of 4 units, are formed in the 4 by 8 rectangular region shown. What is the area of the non-shaded region, in square units? Express the area in the form $a-b\pi$ where $a$ and $b$ are integers.

[asy]

size(4cm,4cm);

pair A,B,C,D,a,b,X;

A=(0,0);
B=(8,0);
C=(8,4);
D=(0,4);

X=(4,4);

draw(A--B--C--D--A);

a=(3,1.5);

fill((A..a..X--D--A--cycle),gray);

draw(A..a..X);

b=(5,1.5);

fill((B..b..X--C--B--cycle),gray);

draw(B..b..X);

label("$8$",midpoint(A--B),S);
label("$4$",midpoint(B--C),E);

[/asy]

The square shown is divided into 4 congruent rectangles. If the perimeter of the square is 144 units, what is the perimeter of one of the four congruent rectangles? [asy]
size(75); defaultpen(linewidth(0.8));
draw(unitsquare);
draw((0,0.25)--(1,0.25)); draw((0,0.5)--(1,0.5)); draw((0,0.75)--(1,0.75));

[/asy]

For the three identical squares shown, points $A$, $B$ and $C$ are vertices, and $AB$ = $2\sqrt{5}$ cm. What is the length of $AC$, in centimeters? Express your answer in simplest radical form.

[asy]
draw((0,0)--(0,10)--(30,10)--(30,0)--cycle);
draw((10,0)--(10,10));
draw((20,0)--(20,10));
draw((0,10)--(20,0),linewidth(1));
label("$A$",(0,10),NW);
label("$B$",(20,0),S);
label("$C$",(30,0),S);
[/asy]

A square carpet of side length 9 feet is designed with one large shaded square and eight smaller, congruent shaded squares, as shown. [asy]

draw((0,0)--(9,0)--(9,9)--(0,9)--(0,0));

fill((1,1)--(2,1)--(2,2)--(1,2)--cycle,gray(.8));

fill((4,1)--(5,1)--(5,2)--(4,2)--cycle,gray(.8));

fill((7,1)--(8,1)--(8,2)--(7,2)--cycle,gray(.8));

fill((1,4)--(2,4)--(2,5)--(1,5)--cycle,gray(.8));

fill((3,3)--(6,3)--(6,6)--(3,6)--cycle,gray(.8));

fill((7,4)--(8,4)--(8,5)--(7,5)--cycle,gray(.8));

fill((1,7)--(2,7)--(2,8)--(1,8)--cycle,gray(.8));

fill((4,7)--(5,7)--(5,8)--(4,8)--cycle,gray(.8));

fill((7,7)--(8,7)--(8,8)--(7,8)--cycle,gray(.8));

label("T",(1.5,7),S);

label("S",(6,4.5),W);

[/asy] If the ratios $9:\text{S}$ and $\text{S}:\text{T}$ are both equal to 3 and $\text{S}$ and $\text{T}$ are the side lengths of the shaded squares, what is the total shaded area?

In rectangle $ABCD$, $AB = 6$ cm, $BC = 8$ cm, and $DE = DF$. The area of triangle $DEF$ is one-fourth the area of rectangle $ABCD$. What is the length in centimeters of segment $EF$? Express your answer in simplest radical form.

[asy]
draw((0,0)--(0,24)--(32,24)--(32,0)--cycle);
draw((13,24)--(32,5));
label("$A$",(0,24),W);
label("$B$",(0,0),W);
label("$C$",(32,0),E);
label("$D$",(32,24),E);
label("$E$",(13,24),N);
label("$F$",(32,5),E);
[/asy]

Piravena must make a trip from $A$ to $B$, then from $B$ to $C$, then from $C$ to $A$.  Each of these three parts of the trip is made entirely by bus or entirely by airplane.  The cities form a right-angled triangle as shown, with $C$ a distance of 3000 km from $A$ and with $B$ a distance of 3250 km from $A$. To take a bus, it costs Piravena $\$0.15$ per kilometer. To take an airplane, it costs her a $\$100$ booking fee, plus $\$0.10$ per kilometer. [asy]

pair A, B, C;

C=(0,0);

B=(0,1250);

A=(3000,0);

draw(A--B--C--A);

label("A", A, SE);

label("B", B, NW);

label("C", C, SW);

label("3000 km", (A+C)/2, S);

label("3250 km", (A+B)/2, NE);

draw((0,125)--(125,125)--(125,0));

[/asy] Determine the distance she travels for her complete trip.
